INSERT INTO `sys_oper_log` VALUES (453, '追踪日志', 2, 'com.ruoyi.hemerdinger.finance.controller.TraceLogController.edit()', 'PUT', 1, 'admin', NULL, '/finance/traceLog', '127.0.0.1', '内网IP', '{\"logType\":\"BASE\",\"code\":\"sz300308\",\"createTime\":1701323044000,\"updateTime\":1701336230245,\"id\":1,\"delFlag\":\"\",\"params\":{},\"content\":\"<p>ROE10%, 目前看一般, 缺少护城河, 需要靠较高的资产周转率, 赚辛苦钱, 负债较低,</p><p>需要关注营业净利率能否提升, 高速光模块能否带来护城河与高毛利.</p><p>安全性较高</p><p>盈利能力适中</p><p>成长性适中, 近期高速光模块可能带来较高增长</p><p>管理能力普通, 总资产周转率0.4, 制造业平均水平</p>\"}', '{\"code\":200,\"msg\":\"操作成功\"}', 0, NULL, '2023-11-30 09:23:50');
INSERT INTO `sys_oper_log` VALUES (454, '追踪日志', 1, 'com.ruoyi.hemerdinger.finance.controller.TraceLogController.add()', 'POST', 1, 'admin', NULL, '/finance/traceLog', '127.0.0.1', '内网IP', '{\"logType\":\"BASE\",\"code\":\"sh603501\",\"createTime\":1701337879795,\"id\":4,\"params\":{},\"content\":\"<p>长期受国产替代利好及经济复苏带动消费复苏利好, 目前国产旗舰机大面积采用韦尔的芯片</p><p>受消费周期影响较大, 目前商品毛利较低, 企业资产周转率有所回升, 处于适中水平, 去库存较为明显</p><p>关注企业利润回升与何时完成去库存</p><p>安全性: 流动负债较高, 现金储备不足, 缺口40亿</p><p>盈利能力波动较大, 5-30之间波动, 高位需要快速离场</p><p>成长性, 较快</p><p>营运能力较强, 资产周转率0.5-1之间波动</p><p><br></p><p><br></p>\"}', '{\"code\":200,\"msg\":\"操作成功\"}', 0, NULL, '2023-11-30 09:51:19');
INSERT INTO `sys_oper_log` VALUES (455, '追踪日志', 1, 'com.ruoyi.hemerdinger.finance.controller.TraceLogController.add()', 'POST', 1, 'admin', NULL, '/finance/traceLog', '127.0.0.1', '内网IP', '{\"logType\":\"TREND\",\"code\":\"sh603501\",\"createTime\":1701338045046,\"id\":5,\"params\":{},\"content\":\"<p>回到30日线上方, 有持续上行的迹象, 走势较强, 可加仓</p>\"}', '{\"code\":200,\"msg\":\"操作成功\"}', 0, NULL, '2023-11-30 09:54:05');
INSERT INTO `sys_oper_log` VALUES (456, '追踪日志', 2, 'com.ruoyi.hemerdinger.finance.controller.TraceLogController.edit()', 'PUT', 1, 'admin', NULL, '/finance/traceLog', '127.0.0.1', '内网IP', '{\"logType\":\"BASE\",\"code\":\"sh603501\",\"createTime\":1701337880000,\"updateTime\":1701340223793,\"id\":4,\"delFlag\":\"0\",\"params\":{},\"content\":\"<p>长期受国产替代利好及经济复苏带动消费复苏利好, 目前国产旗舰机大面积采用韦尔的芯片</p><p>高端摄像头属于寡头竞争格局, 有较高门槛</p><p>但是手机渗透率已经较高, 更换周期降低, 属于存量竞争市场</p><p><br></p><p>受消费周期影响较大, 目前商品毛利较低, 企业资产周转率有所回升, 处于适中水平, 去库存较为明显</p><p>关注企业利润回升与何时完成去库存</p><p><br></p><p>安全性: 流动负债较高, 现金储备不足, 缺口40亿</p><p>盈利能力波动较大, 5-30之间波动, 高位需要快速离场</p><p>成长性, 较快</p><p>营运能力较强, 资产周转率0.5-1之间波动</p><p><br></p>\"}', '{\"code\":200,\"msg\":\"操作成功\"}', 0, NULL, '2023-11-30 10:30:23');
