INSERT INTO `sys_oper_log` VALUES (491, '追踪日志', 2, 'com.ruoyi.hemerdinger.finance.controller.TraceLogController.edit()', 'PUT', 1, 'admin', NULL, '/finance/traceLog', '127.0.0.1', '内网IP', '{\"logType\":\"BASE\",\"code\":\"sh688073\",\"createTime\":1701659007000,\"updateTime\":1701678937679,\"id\":7,\"delFlag\":\"0\",\"params\":{},\"content\":\"<h2>1.是不是好生意</h2><p><br></p><p>          1.1怎么赚钱：各大医药公司重点集中于最终产品研究和市场开拓（设计、销售端），将部分环节进行医药研发外包。提供分子结构的优化, 可以不断通过研发累计数据库提供更丰富的产品</p><p><br></p><p>            1.1.1商业模式:属于转辛苦钱, 利润较低, 需要提高周转对客户依赖性较强, 且大部分客户在欧洲美国, 地缘风险较高</p><p><br></p><p>            1.1.2经营模式: \\t<span style=\\\"color: rgb(0, 0, 0); background-color: rgb(247, 247, 248);\\\">药物分子砌块的研发设计, 生产，销售给创新药、科研院所、CRO机构</span></p><p><br></p><p>            1.1.3.成本构成: \\t主要营业成本占营收50%，主要采购<span style=\\\"color: rgb(0, 0, 0); background-color: rgb(247, 247, 248);\\\">为中间体原料、起始物料和通用试剂， </span>销售、管理费用较高占营收34%，人工费用较高</p><p><br></p><p>          1.2能不能持续：有一定技术壁垒，但是不高，通过积累可能会产生成本优势，目前有一定产品种类优势，药物种类数量高于国内厂商。</p><p><br></p><p>          1.3能不能增长：依靠成本优势，营收增长较快，但是目前增收不增利，目前看不到供需错配，中性</p><p><br></p><h2>2.现金流状况</h2><p><br></p><p>很差 - - - , 均为净流出, 但是目前现金储备较多</p><p><br></p><h2>3.关键财务指标分析</h2><p><br></p><h3>3.1安全性 ， 存货太多，其不断上升，占净资产1/3, 现金较多, 负债较少, 较为安全, 可是现金流不断减少</h3><p><br></p><h3>3.2盈利能力分析, 近期盈利能力较低, 相较于2020年新冠期间明显下滑, 受环境影响较大, 未看到扭转迹象</h3><p><br></p><h3>3.3成长性:营收不断增长, 利润未见增长</h3><p><br></p><h3>3.4管理能力:在一个固定周期,对企业资源的利用次数, 周转率较高, 处于行业平均水平</h3><p><br></p><h2>4.行业竞争格局和公司的比较优势</h2><p><br></p><p>同类型公司不多, 公司拥有价格优势, 目前处于低价竞争抢市场阶段, 市场前景空间较大, 存在国产替代空间.</p><p><br></p><h2>5.股权结构,散户数量</h2><p><br></p><p>散户数量较少, 持股非常集中</p>\"}', '{\"code\":200,\"msg\":\"操作成功\"}', 0, NULL, '2023-12-04 08:35:37');
