INSERT INTO `trace_log` VALUES (1, '', NULL, '2023-11-30 13:44:04', NULL, '2023-11-30 17:23:50', '<p>ROE10%, 目前看一般, 缺少护城河, 需要靠较高的资产周转率, 赚辛苦钱, 负债较低,</p><p>需要关注营业净利率能否提升, 高速光模块能否带来护城河与高毛利.</p><p>安全性较高</p><p>盈利能力适中</p><p>成长性适中, 近期高速光模块可能带来较高增长</p><p>管理能力普通, 总资产周转率0.4, 制造业平均水平</p>', 'sz300308', 'BASE');
INSERT INTO `trace_log` VALUES (2, '0', NULL, '2023-11-30 17:12:50', NULL, NULL, '<p>希望能形成底底高的形态, 不要跌过前低, 海光, 其他的光模块都有突破.</p>', 'sz300308', 'TREND');
INSERT INTO `trace_log` VALUES (4, '0', NULL, '2023-11-30 17:51:20', NULL, '2023-11-30 18:30:36', '<p>长期受国产替代利好及经济复苏带动消费复苏利好, 目前国产旗舰机大面积采用韦尔的芯片</p><p>高端摄像头属于寡头竞争格局, 有较高门槛</p><p>但是手机渗透率已经较高, 更换周期降低, 属于存量竞争市场</p><p>受消费周期影响较大, 目前商品毛利较低, 企业资产周转率有所回升, 处于适中水平, 去库存较为明显</p><p>关注企业利润回升与何时完成去库存</p><p>安全性: 流动负债较高, 现金储备不足, 缺口40亿</p><p>盈利能力波动较大, 5-30之间波动, 高位需要快速离场</p><p>成长性, 较快</p><p>营运能力较强, 资产周转率0.5-1之间波动</p><p><br></p>', 'sh603501', 'BASE');
INSERT INTO `trace_log` VALUES (5, '0', NULL, '2023-11-30 17:54:05', NULL, '2023-12-01 13:24:53', '<p>回到30日线上方, 有持续上行的迹象, 走势较强, 可加仓, </p><p>新筹码平台预计在103附近, 上方压力位平台1111, 可在101-103附近可建仓, 111以上卖出做波段</p><p>上升期波段先买后卖</p>', 'sh603501', 'TREND');
INSERT INTO `trace_log` VALUES (6, '0', NULL, '2023-12-03 18:20:49', NULL, NULL, '<p>强势突破站上5、20、30日均线，观察能否突破60日线并持续上升趋势，目前美元基本确认停止加息，北向有流入趋势，且国资增持科技相关，AI相关产业也不短创新，基本面和资金面良好，坚持持有，形成上升趋势概率较高</p>', 'sz300308', 'TREND');
INSERT INTO `trace_log` VALUES (7, '0', NULL, '2023-12-04 11:03:27', NULL, '2023-12-04 16:35:38', '<h2>1.是不是好生意</h2><p><br></p><p>          1.1怎么赚钱：各大医药公司重点集中于最终产品研究和市场开拓（设计、销售端），将部分环节进行医药研发外包。提供分子结构的优化, 可以不断通过研发累计数据库提供更丰富的产品</p><p><br></p><p>            1.1.1商业模式:属于转辛苦钱, 利润较低, 需要提高周转对客户依赖性较强, 且大部分客户在欧洲美国, 地缘风险较高</p><p><br></p><p>            1.1.2经营模式: 	<span style=\"color: rgb(0, 0, 0); background-color: rgb(247, 247, 248);\">药物分子砌块的研发设计, 生产，销售给创新药、科研院所、CRO机构</span></p><p><br></p><p>            1.1.3.成本构成: 	主要营业成本占营收50%，主要采购<span style=\"color: rgb(0, 0, 0); background-color: rgb(247, 247, 248);\">为中间体原料、起始物料和通用试剂， </span>销售、管理费用较高占营收34%，人工费用较高</p><p><br></p><p>          1.2能不能持续：有一定技术壁垒，但是不高，通过积累可能会产生成本优势，目前有一定产品种类优势，药物种类数量高于国内厂商。</p><p><br></p><p>          1.3能不能增长：依靠成本优势，营收增长较快，但是目前增收不增利，目前看不到供需错配，中性</p><p><br></p><h2>2.现金流状况</h2><p><br></p><p>很差 - - - , 均为净流出, 但是目前现金储备较多</p><p><br></p><h2>3.关键财务指标分析</h2><p><br></p><h3>3.1安全性 ， 存货太多，其不断上升，占净资产1/3, 现金较多, 负债较少, 较为安全, 可是现金流不断减少</h3><p><br></p><h3>3.2盈利能力分析, 近期盈利能力较低, 相较于2020年新冠期间明显下滑, 受环境影响较大, 未看到扭转迹象</h3><p><br></p><h3>3.3成长性:营收不断增长, 利润未见增长</h3><p><br></p><h3>3.4管理能力:在一个固定周期,对企业资源的利用次数, 周转率较高, 处于行业平均水平</h3><p><br></p><h2>4.行业竞争格局和公司的比较优势</h2><p><br></p><p>同类型公司不多, 公司拥有价格优势, 目前处于低价竞争抢市场阶段, 市场前景空间较大, 存在国产替代空间.</p><p><br></p><h2>5.股权结构,散户数量</h2><p><br></p><p>散户数量较少, 持股非常集中</p>', 'sh688073', 'BASE');
INSERT INTO `trace_log` VALUES (8, '0', NULL, '2023-12-04 13:12:25', NULL, NULL, '<p>需要等待行业周期反转, 可以剔除存一半货价值后重新计算最低估值, 进行布局</p>', 'sh688073', 'TREND');
INSERT INTO `trace_log` VALUES (9, '0', NULL, '2023-12-04 23:08:14', NULL, '2023-12-04 23:49:52', '<h2>1.是不是好生意</h2><p><br></p><p>          1.1怎么赚钱：常年保持较高的ROE, 高于常规制造业的营业净利润, 以及较高的周转率</p><p><br></p><p>            1.1.1商业模式 : 有一定技术壁垒, 有落地案例, 目前为行业龙头, 占比58%, </p><p><br></p><p>            1.1.2经营模式:承接数据中心建设或销售液冷产品</p><p><br></p><p>              *主营业务收入构成: 依靠<span style=\"background-color: rgb(254, 254, 254); color: rgb(0, 0, 0);\">浸没相变液冷产品, 冷板产品占比较低</span></p><p><br></p><p>            1.1.3.成本构成: 营业成本占营业收入的60%, 费用较低</p><p><br></p><p>          1.2能不能持续：有一定技术壁垒, 有一定产业链优势, 隶属中科曙光的服务器厂商</p><p><br></p><p>          1.3能不能增长：目前液冷渗透率较低, 6%-8%, 随着AI发展市场空间必定进一步扩大</p><p><br></p><p><br></p><h2>2.现金流状况</h2><p><br></p><p>	+ - + , 蛮牛型, 企业处于扩张期</p><p><br></p><p><br></p><h2>3.关键财务指标分析</h2><p><br></p><h3>3.1安全性 较高</h3><p><br></p><h3>3.2盈利能力分析 高</h3><p><br></p><h3>3.3成长性: 高</h3><p><br></p><h3>3.4管理能力:在一个固定周期,对企业资源的利用次数, 较高</h3><p><br></p><p><br></p><h2>4.行业竞争格局和公司的比较优势</h2><p><br></p><p>浸没式液冷几乎没有对手</p><p><br></p><h2>5.股权结构,散户数量</h2><p><br></p><p>筹码集中</p>', 'bj872808', 'BASE');
INSERT INTO `trace_log` VALUES (10, '0', NULL, '2023-12-06 14:26:42', NULL, NULL, '<p>筹码整理充分, 随时存在突破可能, 等待AI新爆点</p>', 'sh603019', 'TREND');
